import React, {Component} from 'react';
import PropTypes from 'prop-types';
import ApplicationForm from "./ApplicationForm";
import {Link} from "react-router-dom";

class About extends Component {

    render() {
        return (
            <div>
                <Link to='/Rooms'>Go to Rooms</Link>
                <div className="btn" onClick={this.togglePop}>
                    <button>Open Window</button>
                </div>
                {this.state.seen ? <ApplicationForm toggle={this.togglePop} /> : null}
            </div>
        );
    }

    backgroundActivity = () => console.log('Background is active!')
}

About.propTypes = {
    // applicationFormVisible: PropTypes.bool.isRequired
};

export default About;
